#!usr/bin/php

<?php // Plug-in 42: Get Title From URL (http://pluginphp.com/plug-in42.php)

$page = $_ENV["KMVAR_MMD__Link_URL"];
$result = GetTitleFromURL($page);

if (!$result) echo "";
else echo "$result";

function GetTitleFromURL($page)
{

	$context = stream_context_create(array('http' =>
		array(
			'timeout' => 5, //this should be 5, but for some odd reason the download runs longer than the time set here
			)
	));

	$contents = @file_get_contents($page, FALSE, $context, 0, 40000);
	if (!$contents) return FALSE;

   preg_match("/\<title\>(.*)\<\/title\>/", $contents, $matches);
   return $matches[1];
}

?>
